import React from 'react';
import { StyleSheet, Text, View, ScrollView, Dimensions } from 'react-native';

const StoreMenuTab = () => {
    const menuList = [
        {
            menuName: "제육볶음",
            menuDes: "매콤한 돼지고기 볶음",
            menuPrice: "5,500 원"
        },
        {
            menuName: "치킨까스",
            menuDes: "바삭한 치킨까스",
            menuPrice: "5,500 원"
        },
        {
            menuName: "돈까스",
            menuDes: "바삭한 돈까스",
            menuPrice: "5,500 원"
        },
        {
            menuName: "순두부찌개",
            menuDes: "얼큰한 순두부찌개",
            menuPrice: "5,500 원"
        },
        {
            menuName: "김치찌개",
            menuDes: "칼칼한 생고기 김치찌개",
            menuPrice: "5,500 원"
        }
    ]

    return (
        <View style={styles.container}>
            <ScrollView>
                {menuList.map((item) => (
                    <View style={styles.menuEleWrap}>
                        <View style={styles.contentWrap}>
                            <Text style={styles.menuName}>{item.menuName}</Text>
                            <Text style={styles.menuDes}>{item.menuDes}</Text>
                            <Text style={styles.menuPrice}>{item.menuPrice}</Text>
                        </View>
                        <View style={styles.menuThumbnail}>
                        </View>
                    </View>
                ))}
            </ScrollView>
        </View>
    );

}

const styles = StyleSheet.create({
    container: {
        flex: 1,
        backgroundColor: '#FFFFFF',
    },
    menuEleWrap: {
        flexDirection: 'row',
        alignItems: 'center',
        justifyContent: 'space-between',
        borderStyle: 'solid',
        borderBottomWidth: 1,
        borderBottomColor: '#d3d3d3',
        padding: 20,
    },
    contentWrap: {

    },
    menuName: {
        fontFamily: 'Medium',
        fontSize: 15
    },
    menuDes: {
        fontFamily: 'Regular',
        fontSize: 12
    },
    menuPrice: {
        fontFamily: 'Light',
        fontSize: 12
    },
    menuThumbnail: {
        backgroundColor: "#ff9933",
        width: Dimensions.get('window').width * 0.13,
        height: Dimensions.get('window').width * 0.13,
        alignItems: "center",
        justifyContent: 'center',
        borderRadius: Dimensions.get('window').width * 0.13
    },
});

export default StoreMenuTab;
